import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from 'react';
import './App.css';
import Navbar from './components/Navbar';     

import { datadr } from './datadr.json';

class App extends Component {
  constructor(){
    super();
    this.state = {
      datadr
    }
  }
  render() {
    const datadr = this.state.datadr.map((datadr, i) => {
      return(
        <div className="card"> 
        {datadr.name}
        </div>
      )

    }
    );
    return (
      <div className="App">
        <header className="">
          <Navbar/>

        </header>
      </div>
    );
  }
}

export default App;
